import "./App.css";
import { FaKey } from "react-icons/fa";

function App() {
  return (
    <div className="w-[570px] h-[350px] bg-[#1A2226] mx-auto mt-[15%]">
      <div>
        <div>
          <FaKey />
        </div>
        <div className="text-[ECF0F5] font-semibold text-[30px]">ADMIN PANEL</div>
      </div>
      <div></div>
      <div></div>
    </div>
  );
}

export default App;
